import React from 'react';
import MuithemeProvider from "@material-ui/core/styles/MuiThemeProvider";
import theme from "./theme/theme";
import {Button, TextField} from '@material-ui/core';

function App() {
  return (
    //El param q va ingresar sera {theme} q definimos anteriromnt
    <MuithemeProvider theme={theme}>
      <h1>Proyecto en blanco</h1>

      {/* componente tipo caja d texto*/}
      <TextField variant="outlined" />

      {/* contained = color d fondo, color hereda dl primary*/}
      <Button variant = "contained" color="primary">Mi Boton Material Design</Button>



    </MuithemeProvider>
  );
}

export default App;
